        const oldCell = this.field[ fromI ][ fromJ ];
        const newCell = this.field[ toI ][ toJ ];

        // this.field[ toI ][ toJ ] = oldCell;

        if (name === 'right' || name === 'down') {
            this.field[ toI ][ toJ ]     = oldCell;
            this.field[ fromI ][ fromJ ] = newCell;
        } else {
            this.field[ toI ][ toJ ]     = oldCell;
            this.field[ fromI ][ fromJ ] = newCell;
        }

        this.updateIndexes();

        this.selectCell(oldCell);
    }

